import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { GiMushroomHouse } from "react-icons/gi";
import { IoMdCreate } from "react-icons/io";
import { FiPaperclip } from "react-icons/fi";
import { IoIosPaperPlane } from "react-icons/io";
import { FaGithub } from "react-icons/fa";
import { FaLinkedin } from "react-icons/fa";
import { FaCodepen } from "react-icons/fa";

import './menu.css';

export default props => {
    return (
        <Menu className="menu" width={'30%'} >
            <a className="menu-picture" >

            </a>

            <a className="menu-picture" >
                <li className="social-items">
                <a className="menu-item" href="http://github.com/leahtbriggs">
                    <FaGithub/>
                </a>

                <a className="menu-item" href="https://www.linkedin.com/in/leahbriggs/">
                    <FaLinkedin/>
                </a>

                <a className="menu-item" href="https://codepen.io/leahmakesstuff">
                    <FaCodepen/>
                </a>
                </li>
            </a>

            <a className="menu-item" href="http://github.com/leahtbriggs">
                <FaGithub/>
            </a>

            <a className="menu-item" href="https://www.linkedin.com/in/leahbriggs/">
                <FaLinkedin/>
            </a>

            <a className="menu-item" href="https://codepen.io/leahmakesstuff">
                <FaCodepen/>
            </a>


            <a className="menu-item" href="/" >
                <GiMushroomHouse/> Home
            </a>

            <a className="menu-item" href="/projects">
                <IoMdCreate/> Projects
            </a>

            <a className="menu-item" href="/">
                <FiPaperclip/> Resume
            </a>

            <a className="menu-item" href="/contact">
                <IoIosPaperPlane/> Contact
            </a>
        </Menu>
    );
};
